const ReviewsRating = () => {
  return (
   <>
   <div className="container py-4">
      {/* Header Section */}
      <div className="d-flex justify-content-between align-items-center bg-primary text-light p-3 rounded">
        <img src="/images/ReviewsRatings.png" alt="Price Trend" width="64" />
      </div>

      {/* Title Section */}
      <div className="text-center mt-3">
        <h1 className="fw-bold">Check Reviews &amp; Ratings</h1>
        <p className="fs-5 fw-semibold">in India</p>
      </div>
      </div>
   </>
  )
}

